import React, { useState } from 'react'
import { MyBooking } from './myBooking/MyBooking';
import { PropertyList } from './propertyList/PropertyList';
import { BookingContext } from './BookingContext';
import { Property } from '../../generated/graphql';
import { Moment } from 'moment';

interface Props {

}


export const BookingRouter:  React.FC<Props> = () => {

    const [selectedProperty, setSelectedProp] = useState();
    const [arrivalDate, setArrivalD] = useState();
    const [departureDate, setDepartureD] = useState();

    const setSelectedPropterty = () => (property: Property | undefined): void => {
        setSelectedProp(property)
        console.log(property)
    }

    const setArrivalDate = () => (arrival: Moment | undefined): void => {
        setArrivalD(arrival);
    }

    const setDepartureDate = () => (departure: Moment | undefined): void => {
        setDepartureD(departure);
    }

    const values = {
        selectedProperty,
        arrivalDate,
        departureDate,
        setSelectedPropterty,
        setArrivalDate,
        setDepartureDate
    }


    return (
        <div>
            <BookingContext.Provider value={values}>
                <MyBooking ></MyBooking>
                <PropertyList ></PropertyList>
            </BookingContext.Provider>
        </div>
    )

}
